+ (void)drawClockComponents
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    UIColor* plum = [UIColor colorWithRed: 0.393 green: 0.301 blue: 0.5 alpha: 1];

    //// Oval Drawing
    UIBezierPath* ovalPath = [UIBezierPath bezierPathWithOvalInRect: CGRectMake(2, 2, 24, 24)];
    [plum setFill];
    [ovalPath fill];


    //// Hours
    {
        //// Rectangle Drawing
        UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(13.5, 2, 1, 24)];
        [UIColor.whiteColor setFill];
        [rectanglePath fill];


        //// Rectangle 2 Drawing
        UIBezierPath* rectangle2Path = [UIBezierPath bezierPathWithRect: CGRectMake(2, 13.5, 24, 1)];
        [UIColor.whiteColor setFill];
        [rectangle2Path fill];


        //// Rectangle 3 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 30 * M_PI / 180);

        UIBezierPath* rectangle3Path = [UIBezierPath bezierPathWithRect: CGRectMake(-0.5, -12, 1, 24)];
        [UIColor.whiteColor setFill];
        [rectangle3Path fill];

        CGContextRestoreGState(context);


        //// Rectangle 4 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 60 * M_PI / 180);

        UIBezierPath* rectangle4Path = [UIBezierPath bezierPathWithRect: CGRectMake(-0.5, -12, 1, 24)];
        [UIColor.whiteColor setFill];
        [rectangle4Path fill];

        CGContextRestoreGState(context);


        //// Rectangle 5 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 120 * M_PI / 180);

        UIBezierPath* rectangle5Path = [UIBezierPath bezierPathWithRect: CGRectMake(-0.5, -12, 1, 24)];
        [UIColor.whiteColor setFill];
        [rectangle5Path fill];

        CGContextRestoreGState(context);


        //// Rectangle 6 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 150 * M_PI / 180);

        UIBezierPath* rectangle6Path = [UIBezierPath bezierPathWithRect: CGRectMake(-0.5, -12, 1, 24)];
        [UIColor.whiteColor setFill];
        [rectangle6Path fill];

        CGContextRestoreGState(context);
    }


    //// Seconds
    {
        //// Second 2 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 6 * M_PI / 180);

        UIBezierPath* second2Path = [UIBezierPath bezierPath];
        [second2Path moveToPoint: CGPointMake(-0.25, 12)];
        [second2Path addLineToPoint: CGPointMake(0.25, 12)];
        [second2Path addLineToPoint: CGPointMake(0.25, -12)];
        [second2Path addLineToPoint: CGPointMake(-0.25, -12)];
        [second2Path addLineToPoint: CGPointMake(-0.25, 12)];
        [second2Path closePath];
        [UIColor.whiteColor setFill];
        [second2Path fill];

        CGContextRestoreGState(context);


        //// Second 3 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 12 * M_PI / 180);

        UIBezierPath* second3Path = [UIBezierPath bezierPath];
        [second3Path moveToPoint: CGPointMake(-0.25, 12)];
        [second3Path addLineToPoint: CGPointMake(0.25, 12)];
        [second3Path addLineToPoint: CGPointMake(0.25, -12)];
        [second3Path addLineToPoint: CGPointMake(-0.25, -12)];
        [second3Path addLineToPoint: CGPointMake(-0.25, 12)];
        [second3Path closePath];
        [UIColor.whiteColor setFill];
        [second3Path fill];

        CGContextRestoreGState(context);


        //// Second 6 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 14, 14);
        CGContextRotateCTM(context, 162 * M_PI / 180);

        UIBezierPath* second6Path = [UIBezierPath bezierPath];
        [second6Path moveToPoint: CGPointMake(-0.25, 12)];
        [second6Path addLineToPoint: CGPointMake(0.25, 12)];
        [second6Path addLineToPoint: CGPointMake(0.25, -12)];
        [second6Path addLineToPoint: CGPointMake(-0.25, -12)];
        [second6Path addLineToPoint: CGPointMake(-0.25, 12)];
