    [PaintCodeStyleKit drawStopwatchColored];

    _imageOfStopwatchColored = UIGraphicsGetImageFromCurrentImageContext();
    UIGraphicsEndImageContext();

    return _imageOfStopwatchColored;
}

+ (UIImage*)imageOfCheckmark
{
    if (_imageOfCheckmark)
        return _imageOfCheckmark;

    UIGraphicsBeginImageContextWithOptions(CGSizeMake(34, 34), NO, 0.0f);
    [PaintCodeStyleKit drawCheckmark];

    _imageOfCheckmark = UIGraphicsGetImageFromCurrentImageContext();
    UIGraphicsEndImageContext();

    return _imageOfCheckmark;
}

